INSERT INTO `jw_yemian` (`yemianid`, `fumulu`, `zimulu`, `sanjimulu`, `biaoti`, `fabuzhe`, `faburiqi`, `fabuneirong`, `yemian`) VALUES
	(1, 1, 1, 0, '运用车间机车二队第十二指导组简介', 10, '2018-10-04 16:24:23', '/static/upload/groupculture/introduce/id10.jpg||班组logo以蓝色为基调，取源于SS4B机车的天空蓝；标志左右两侧的橄榄枝，寓意着安定与和谐；标志上方为国家能源集团缩写；标志下方为运用车间追求的工作理想；标志中间的组合图案是“家”字的形象化，火车和铁路代表着行业特征；五条不同颜色的几何图案代表着五型建设，寓意着通过五型建设来强化我们的家，来撑起我们的事业。||神北运用车间机车二队第十二指导组是神朔铁路分公司机务段的基层班组。2006年6月6日正式成立，先后被定编为第六指导组、第八指导组、第十指导组，2015年定编为第十二指导组。在时间的长河中奋力前行了11年，积累了丰富而宝贵的行车经验，为神朔铁路发展腾飞做出了应有的贡献。2017年6月，该指导组89/90乘务组被授予“全国青年文明号”。\r\n目前，该指导组由36名品学兼优的青年组成。其中司机16名，学习司机16名，学员4名。本科学历9人，大专及以上学历17人，中专学历10人，党员5名，共青团员24名,指导组平均年龄27岁。||/static/upload/groupculture/introduce/table10.png||/static/upload/groupculture/stuffpresence/id10/(1).jpg||/static/upload/groupculture/stuffpresence/id10/(2).jpg||/static/upload/groupculture/stuffpresence/id10/(3).jpg||/static/upload/groupculture/stuffpresence/id10/(4).jpg||/static/upload/groupculture/stuffpresence/id10/(5).jpg||/static/upload/groupculture/stuffpresence/id10/(6).jpg||/static/upload/groupculture/stuffpresence/id10/(7).jpg||/static/upload/groupculture/stuffpresence/id10/(8).jpg||/static/upload/groupculture/stuffpresence/id10/(9).jpg||/static/upload/groupculture/stuffpresence/id10/(10).jpg||/static/upload/groupculture/stuffpresence/id10/(11).jpg||/static/upload/groupculture/stuffpresence/id10/(12).jpg||/static/upload/groupculture/stuffpresence/id10/(13).jpg||/static/upload/groupculture/stuffpresence/id10/(14).jpg', 'culter.html'),
