	(5, 1, 1, 0, '后勤第三食堂班组简介', 11, '2018-10-04 16:24:23', '/static/upload/groupculture/introduce/id11.jpg||同心协力、团结一致、为将我班建设成标杆班组加油||机务段神木北后勤服务中心自主餐厅于2002年建成并启用，前身为公寓食堂，2016年改建为自主餐厅，可同时容纳180人就餐，餐厅配有各类现代化设备，一流的服务和专业的厨师团队。自助餐厅的成立是后勤服务中心扎实推进民生工程的重要一步，自助餐厅秉持让职工吃健康、吃营养、吃丰富的原则，在严格执行食品安全法律法规的同时，不断丰富职工的菜盘子，增加职工就餐选择的多样化。||/static/upload/groupculture/introduce/table10.png||/static/upload/groupculture/stuffpresence/id11/(1).JPG||/static/upload/groupculture/stuffpresence/id11/(2).JPG||/static/upload/groupculture/stuffpresence/id11/(3).JPG||/static/upload/groupculture/stuffpresence/id11/(4).JPG||/static/upload/groupculture/stuffpresence/id11/(5).JPG||/static/upload/groupculture/stuffpresence/id11/(6).JPG||/static/upload/groupculture/stuffpresence/id11/(7).JPG', 'culter.html'),
