	(9, 1, 1, 0, '朱盖塔运用车间交流六队班组简介', 12, '2018-10-04 16:24:23', '/static/upload/groupculture/introduce/id12.jpg||LOGO整体形象是一台运行着的交流电力机车，象征班组的工作性质和使命。上部五个色块代表“五型”班组的五个类型——学习型、安全型、质量型、节约型、创新型；下部是英文字母“J”和数字“6”的变形，“J”代表交流机车，“6”代表六队，其中“6”上部的一长横代表交流六队，三短横代表三个指导组，右下部的十细横代表十个乘务组，以上要素组成的“6”彼此相连，既反映车队组织结构，又寓意交流六队全体成员在朱盖塔运用车间的坚强带领下，团结一致、紧密合作，共同创造更加辉煌的业绩。||交流六队隶属于机务段朱盖塔运用车间，成立于2017年3月，下设三个指导组，分管十个乘务组。现有人员状况：车队长1名，指导司机3名，机车司机46名，学习司机36名，学员3名，共计89人。平均年龄31岁，其中党员3名，平均文化程度大专。班组自成立以来\r\n在车间科学正确领导下，秉持“违章就是事故，安全才能幸福”的安全理念，充分发挥班组凝聚力战斗力，出色的完成了各项工作。站在新的起点上，车队将以公司“122”战略为指引，以安全、稳定、畅通为目标，继续发挥苦干实干精神，全面打造一支出则能战、战则必\r\n胜的乘务铁军。\r\n||/static/upload/groupculture/introduce/table12.jpg||/static/upload/groupculture/stuffpresence/id12/(1).JPG||/static/upload/groupculture/stuffpresence/id12/(2).JPG||/static/upload/groupculture/stuffpresence/id12/(3).JPG||/static/upload/groupculture/stuffpresence/id12/(4).JPG||/static/upload/groupculture/stuffpresence/id12/(5).JPG||/static/upload/groupculture/stuffpresence/id12/(6).JPG||/static/upload/groupculture/stuffpresence/id12/(7).JPG||/static/upload/groupculture/stuffpresence/id12/(8).JPG||/static/upload/groupculture/stuffpresence/id12/(9).JPG||/static/upload/groupculture/stuffpresence/id12/(10).JPG||/static/upload/groupculture/stuffpresence/id12/(11).JPG||/static/upload/groupculture/stuffpresence/id12/(12).JPG||/static/upload/groupculture/stuffpresence/id12/(13).JPG||/static/upload/groupculture/stuffpresence/id12/(14).JPG', 'culter.html'),
