	(1694, 1, 1, 0, '检修车间备品三组班组简介', 106, '2018-11-08 23:10:17', '/static/upload/groupculture/introduce/id13.jpg||大、小圆组成的圆形边框象征着铁路，代表我们神朔铁路公司，上面镶嵌着的五颗钻石代表五型班组建设，中间扬起的三面风帆代表备品三组以及班组电子、制动、仪表的三个工种，下面托举的手形树叶代表机务段和检修车间，整体图案的寓意是备品三组在段、车间的领导和支持下，班组全体人员团结一心、努力拼搏，在公司“一体两翼两保障”发展战略指引下，扬帆起航、奋勇争先！||班组成立于2009年，班组现有职工21人，工长1名、副工长1名，女职工15人，平均年龄30岁，高级工以上10人.主要担负着全公司约300台电力机车的制动系统配件、电子配件、整流柜、仪表配件等核心部件的检修、试验工作。年维修配件共计5万余件，班组日维修量280余件,个人每天大约维修20余件。确保每一个配件保质保量提供给机车，是我们唯一的目标。班组也多次获得公司、段先进班组、先进集体以及 “巾帼建功”等荣誉称号。班组员工在集团公司组织的技能大赛中分别获得第一名、第三名的优秀成绩。||/static/upload/groupculture/introduce/table13.png||/static/upload/groupculture/stuffpresence/id13/安全检查.JPG|| /static/upload/groupculture/stuffpresence/id13/安全签名.JPG||/static/upload/groupculture/stuffpresence/id13/班组点名.JPG||/static/upload/groupculture/stuffpresence/id13/班组合影1.JPG||/static/upload/groupculture/stuffpresence/id13/班组合影2.JPG||/static/upload/groupculture/stuffpresence/id13/备品三.JPG||/static/upload/groupculture/stuffpresence/id13/党员示范岗.JPG||/static/upload/groupculture/stuffpresence/id13/冯雅兰.JPG||/static/upload/groupculture/stuffpresence/id13/活动1.JPG||/static/upload/groupculture/stuffpresence/id13/活动2.JPG||/static/upload/groupculture/stuffpresence/id13/活动照片.JPG||/static/upload/groupculture/stuffpresence/id13/技术比武.JPG||/static/upload/groupculture/stuffpresence/id13/接力比赛活动.JPG||/static/upload/groupculture/stuffpresence/id13/李莎.JPG||/static/upload/groupculture/stuffpresence/id13/领导参观1.JPG||/static/upload/groupculture/stuffpresence/id13/领导参观2.JPG||/static/upload/groupculture/stuffpresence/id13/女工.JPG||/static/upload/groupculture/stuffpresence/id13/女工2.JPG||/static/upload/groupculture/stuffpresence/id13/女工3.JPG||/static/upload/groupculture/stuffpresence/id13/胥婷婷.JPG', 'culter.html'),
	(1695, 3, 9, 0, '2018-11-10 00:56:40.229000 班前班后会', 106, '2018-11-10 00:56:40', '/static/upload/learnplace/id11/studymaterial/regulations/2.doc||神朔铁路分公司机务段神北后勤班前班后管理办法（试行）||18||1||3||无||班前传达学习以及安全预想1||本班作业中生产任务以及作业情况11', 'bpage.html'),
	(1696, 3, 9, 0, '2018-11-10 17:03:31.009000 班前班后会', 106, '2018-11-10 17:03:31', '22||22||0||0||无||2017年，在集团公司的坚强领导下，公司发展克服了诸多困难和难题，全体神朔员工以坚定的信心和非凡的勇气，逢山开路，遇水架桥，安全生产有序可控，圆满完成了各项经营任务。运量、利润等生产指标再创历年新高，名列集团子分公司前茅，在集团经营业绩考评中获A级企业。||我们不断优化运输作业组织，不折不扣完成了集团下达的日、周轮廓计划。通过450MHZ弱场补强施工、新城川至孤山川困难区间信号扩容改造、机车列尾转信设备换装升级，使“3+0”单元万吨开行达图定25对，具备了12‰长大坡道牵引108辆单元万吨能力，填补了国际空白。直通包神万吨列车达到图定6对水平，包神管内平均周时压缩至4小时以内，为集团实施大运输战略创造了条件。寇庄万吨会让站站改完成、长交路拉通包神南线、包乘制改轮乘制，为集团实现长交路做好了准备。不断优化作业环节，压缩效率指标，实现无缝衔接，全年中时4.6小时，同比压缩0.2小时，停时7.2小时，同比压缩0.1小时。承担了神池南站2+1牵引C80万吨车底组合单元万吨任务，使神池南站运输瓶颈问题得到缓解。协助包神、货车等兄弟单位开展大物流运输，年内完成非煤品运输403万吨，增加运输收入1.27亿元。||全面推进和落实集团公司“一学、两做、两查、四确保”专项行动。同时要持续抓好干部下现场工作。以现场督办、落实考核为途径，形成服务基层、指导现场、组织生产、解决问题的安全管理机制。要建立健全安全管理责任追究机制，实施责任倒查追究，杜绝责任空档。运用实时监控系统等现代化手段实现现场安全，杜绝“三违”出现、隐患萌发，全面实现现场作业技防、物防持续化和常态化。进一步加大科技保安全力度，切实解决自动过分相等集团挂牌督办的安全事项，用好安全专项资金，切实发挥好安全资金的真作用。', 'bpage.html'),
